(2, 'privacy', 'privacy', 'privacy', '<p><strong>Privacy Policy</strong></p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p>Protecting your private information is our priority. This Statement of Privacy applies to Lyve Show Apps, and Lyve Show LLC and governs data collection and usage. For the purposes of this Privacy Policy, unless otherwise noted, all references to Lyve Show LLC include www.lyveshow.com and Lyve Show. The Lyve Show application is a Streaming and video on demand service for content creators and a platform for viewers to watch videos and live streams application. By using the Lyve Show application, you consent to the data practices described in this statement.&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;<strong>Collection of your Personal Information</strong></p>\r\n\r\n<p>In order to better provide you with products and services offered, Lyve Show may collect personally identifiable information, such as your:&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<th>&nbsp;</th>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>-</td>\r\n			<td>First and Last Name</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<th>&nbsp;</th>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>-</td>\r\n			<td>Mailing Address</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<th>&nbsp;</th>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>-</td>\r\n			<td>E-mail Address</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;If you purchase Lyve Show&#39;s products and services, we collect billing and credit card information. This information is used to complete the purchase transaction.&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;Lyve Show may also collect anonymous demographic information, which is not unique to you, such as your:&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<th>&nbsp;</th>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>-</td>\r\n			<td>Age</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<th>&nbsp;</th>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>-</td>\r\n			<td>Gender</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<th>&nbsp;</th>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>-</td>\r\n			<td>Geographical region</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>We do not collect any personal information about you unless you voluntarily provide it to us. However, you may be required to provide certain personal information to us when you elect to use certain products or services. These may include: (a) registering for an account; (b) entering a sweepstakes or contest sponsored by us or one of our partners; (c) signing up for special offers from selected third parties; (d) sending us an email message; (e) submitting your credit card or other payment information when ordering and purchasing products and services. To wit, we will use your information for, but not limited to, communicating with you in relation to services and/or products you have requested from us. We also may gather additional personal or non-personal information in the future.&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p><strong>Use of your Personal Information&nbsp;</strong></p>\r\n\r\n<p>Lyve Show collects and uses your personal information to operate and deliver the services you have requested.&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;Lyve Show may also use your personally identifiable information to inform you of other products or services available from Lyve Show and its affiliates.&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p><strong>Sharing Information with Third Parties</strong></p>\r\n\r\n<p>Lyve Show does not sell, rent or lease its customer lists to third parties.&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;Lyve Show may, from time to time, contact you on behalf of external business partners about a particular offering that may be of interest to you. In those cases, your unique personally identifiable information (e-mail, name, address, telephone number) is not transferred to the third party. Lyve Show may share data with trusted partners to help perform statistical analysis, send you email or postal mail, provide customer support, or arrange for deliveries. All such third parties are prohibited from using your personal information except to provide these services to Lyve Show, and they are required to maintain the confidentiality of your information.&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p>Lyve Show may disclose your personal information, without notice, if required to do so by law or in the good faith belief that such action is necessary to: (a) conform to the edicts of the law or comply with legal process served on Lyve Show or the site; (b) protect and defend the rights or property of Lyve Show; and/or (c) act under exigent circumstances to protect the personal safety of users of Lyve Show, or the public.&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p><strong>Right to Deletion</strong></p>\r\n\r\n<p>Subject to certain exceptions set out below, on receipt of a verifiable request from you, we will:&nbsp;</p>\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n		</tr>\r\n		<tr>\r\n			<td>&bull;</td>\r\n			<td>Delete your personal information from our records; and</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n		</tr>\r\n		<tr>\r\n			<td>&bull;</td>\r\n			<td>Direct any service providers to delete your personal information from their records.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;Please note that we may not be able to comply with requests to delete your personal information if it is necessary to:&nbsp;</p>\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n		</tr>\r\n		<tr>\r\n			<td>&bull;</td>\r\n			<td>Complete the transaction for which the personal information was collected, fulfill the terms of a written warranty or product recall conducted in accordance with federal law, provide a good or service requested by you, or reasonably anticipated within the context of our ongoing business relationship with you, or otherwise perform a contract between you and us;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n		</tr>\r\n		<tr>\r\n			<td>&bull;</td>\r\n			<td>Detect security incidents, protect against malicious, deceptive, fraudulent, or illegal activity; or prosecute those responsible for that activity;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n		</tr>\r\n		<tr>\r\n			<td>&bull;</td>\r\n			<td>Debug to identify and repair errors that impair existing intended functionality;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n		</tr>\r\n		<tr>\r\n			<td>&bull;</td>\r\n			<td>Exercise free speech, ensure the right of another consumer to exercise his or her right of free speech, or exercise another right provided for by law;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n		</tr>\r\n		<tr>\r\n			<td>&bull;</td>\r\n			<td>Comply with the California Electronic Communications Privacy Act;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n		</tr>\r\n		<tr>\r\n			<td>&bull;</td>\r\n			<td>Engage in public or peer-reviewed scientific, historical, or statistical research in the public interest that adheres to all other applicable ethics and privacy laws, when our deletion of the information is likely to render impossible or seriously impair the achievement of such research, provided we have obtained your informed consent;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n		</tr>\r\n		<tr>\r\n			<td>&bull;</td>\r\n			<td>Enable solely internal uses that are reasonably aligned with your expectations based on your relationship with us;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n		</tr>\r\n		<tr>\r\n			<td>&bull;</td>\r\n			<td>Comply with an existing legal obligation; or</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n		</tr>\r\n		<tr>\r\n			<td>&bull;</td>\r\n			<td>Otherwise use your personal information, internally, in a lawful manner that is compatible with the context in which you provided the information.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p><strong>Children Under Thirteen</strong></p>\r\n\r\n<p>Lyve Show does not knowingly collect personally identifiable information from children under the age of thirteen. If you are under the age of thirteen, you must ask your parent or guardian for permission to use this application.&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p><strong>E-mail Communications</strong></p>\r\n\r\n<p>From time to time, Lyve Show may contact you via email for the purpose of providing announcements, promotional offers, alerts, confirmations, surveys, and/or other general communication.&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p><strong>External Data Storage Sites</strong></p>\r\n\r\n<p>We may store your data on servers provided by third party hosting vendors with whom we have contracted.&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p><strong>Changes to this Statement</strong></p>\r\n\r\n<p>Lyve Show reserves the right to change this Privacy Policy from time to time. We will notify you about significant changes in the way we treat personal information by sending a notice to the primary email address specified in your account, by placing a prominent notice on our application, and/or by updating any privacy information. Your continued use of the application and/or Services available after such modifications will constitute your: (a) acknowledgment of the modified Privacy Policy; and (b) agreement to abide and be bound by that Policy.&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p><strong>Contact Information</strong></p>\r\n\r\n<p>Lyve Show welcomes your questions or comments regarding this Statement of Privacy. If you believe that Lyve Show has not adhered to this Statement, please contact Lyve Show at:&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p>Lyve Show LLC&nbsp;</p>\r\n\r\n<p>7965 FL-50 STE 1000-163&nbsp;</p>\r\n\r\n<p>Groveland, Florida 34736&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p>Email Address:&nbsp;</p>\r\n\r\n<p>hello@lyveshow.com&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>Effective as of April 06, 2021</p>', 'privacy', 1, NULL, '2021-03-23 14:02:21', '2021-04-06 22:33:21'),
(3, 'terms', 'terms', 'terms', '<p><strong>Terms and Conditions</strong></p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p><strong>Agreement between User and www.lyveshow.com</strong></p>\r\n\r\n<p>Welcome to www.lyveshow.com. The www.lyveshow.com website (the &quot;Site&quot;) is comprised of various web pages operated by Lyve Show LLC (&quot;Lyve Show&quot;). www.lyveshow.com is offered to you conditioned on your acceptance without modification of the terms, conditions, and notices contained herein (the &quot;Terms&quot;). Your use of www.lyveshow.com constitutes your agreement to all such Terms. Please read these terms carefully, and keep a copy of them for your reference.&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p>www.lyveshow.com is a Social Networking Site.&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p>Lyve Show LLC was created to provide artists, musicians, and theaters, a way to stream their events. The service is free to use, and a 10 percent commission will be charged on tickets and orders placed for every event, to cover the platform fees and labor.&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p><strong>Electronic Communications</strong></p>\r\n\r\n<p>Visiting www.lyveshow.com or sending emails to Lyve Show constitutes electronic communications. You consent to receive electronic communications and you agree that all agreements, notices, disclosures and other communications that we provide to you electronically, via email and on the Site, satisfy any legal requirement that such communications be in writing.&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p><strong>Your Account</strong></p>\r\n\r\n<p>If you use this site, you are responsible for maintaining the confidentiality of your account and password and for restricting access to your computer, and you agree to accept responsibility for all activities that occur under your account or password. You may not assign or otherwise transfer your account to any other person or entity. You acknowledge that Lyve Show i