(5, 'faq', 'faq', 'faq', '<p>FAQ</p>\r\n\r\n<p><em><strong>What is Lyve Show?</strong></em></p>\r\n\r\n<p>Lyve Show is a streaming service for artists, musicians, theaters, and any content creator who would like to sell their live stream events to their followers. Lyve Show makes it easy and affordable for content creators to sell live events.&nbsp;</p>\r\n\r\n<p><em><strong>Is Lyve Show free to use?</strong></em></p>\r\n\r\n<p>Lyve Show is free to use for artists, musicians, theaters, and content creators. A 10 percent fee is deducted from each sale for website maintenance and labor.&nbsp;</p>\r\n\r\n<p>Lyve Show is also free for viewers. Lyve Show provides a platform for viewers to sign up for free and follow their favorite artist. Viewers can also purchase live-streamed events or an on-demand version of the event if the viewer was unable to attend or watch the event live.&nbsp;</p>\r\n\r\n<p><em><strong>What kind of events are allowed on Lyve Show?</strong></em></p>\r\n\r\n<p>Anything from concerts and plays, to charity events and more. Lyve Show is a family-owned and family-oriented business. We will continue to monitor events and streams, and have the right to cancel or terminate, accounts and live streams if they violate any state and website laws.</p>\r\n\r\n<p><em><strong>Do you offer promotion opportunities?</strong></em></p>\r\n\r\n<p>Lyve Show is a growing platform that will allow artists and event coordinators to promote their events on our home page. More information to come soon!&nbsp;</p>', 'faq', 1, NULL, '2021-03-23 14:02:21', '2021-04-06 22:46:52'),
(6, 'help', 'help', 'help', 'help', 'help', 1, '2021-03-29 18:46:52', '2021-03-23 14:02:21', '2021-03-29 18:46:52'),
